        id: this.form.id,
        name: this.form.name,
        url: this.form.url,
        index: this.form.index,
        fatherId: this.form.fatherId,
        type: this.form.type,
        icon: this.form.icon,
        remark: this.form.remark
      }).then(function (res) {
